import React, { useState } from 'react';
function RowData(props){
    return(
        <>
            <div>
                <table className='table'>
                    <tr className='tr'>
                        <td>
                            {props.compamy.name}
                        </td>
                    </tr>
                </table>
            </div>
        </>
    );
}
export default RowData;
